import React from 'react';

const ProfessionalExperience = () => {
    return (
        <section id="professional-experience">
            <h2>Professional Experience</h2>
            <ul>
                <li>
                    <strong>Software Engineer II</strong> - Tata Consultancy Service, Chicago, IL (Jan 2021 â€“ Sep 2024)
                    <ul>
                        <li>Developed and maintained scalable, resilient distributed systems using Java, enhancing performance, and ensuring zero downtime.</li>
                        <li>Designed and implemented RESTful APIs and microservices, ensuring seamless integration with front-end systems.</li>
                        <li>Participated in design sessions and code reviews, contributing to high-quality engineering practices.</li>
                        <li>Utilized Spring Boot and Spring Framework for developing back-end services, deploying them within a containerized infrastructure using Docker and Kubernetes.</li>
                        <li>Conducted database design and performance tuning in PostgreSQL, optimizing queries, data sharding, and partitioning.</li>
                        <li>Collaborated cross-functionally throughout the software lifecycle, promoting a culture of continuous improvement.</li>
                    </ul>
                </li>
            </ul>
        </section>
    );
};

export default ProfessionalExperience;
